import React, { Component } from 'react';
import './index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import Contact from './contact'
import Home from './home'
import Contact_form from './contact_form'
import {
  Collapse,
  Navbar,
  NavbarToggler,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
   } from 'reactstrap';

import logo from './images/logo.png';


export default class App extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>

        <Navbar color="light" light expand="sm" class="navigation">
        <img src={logo} alt="Logo" />
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
              <NavLink className="list" href="Home/components/">Home</NavLink>
              </NavItem>

              <NavItem>
              <NavLink className="list" href="Home/components/">About Us</NavLink>
              </NavItem>
              <NavItem>
              <NavLink className="list" href="Services/components/">Solutions / Services</NavLink>
              </NavItem>
              <NavItem>
              <NavLink className="list" href="Home/components/">Our Work</NavLink>
              </NavItem>
              <NavItem>
              <NavLink className="list" href="Home/components/">Contact</NavLink>
              </NavItem>





            </Nav>
          </Collapse>
        </Navbar>
                <Contact></Contact> 
                <Home></Home>   


            </div>
        );
    }
}
